var selectedLangTag = "en";

function JS_List_Jump(){
	document.location.href=document.frm.cbo.options[document.frm.cbo.selectedIndex].value;
}

function loadObjectPages(url, target) {
	if (searchObject(url) == false) {
		alert(properties[selectedLangTag]['wp_objectNotExported']);
	}
        else {
		if (target == "model") {
			top.model.location.href=url + "_nav.htm";
		}
		else if (target == "info") {
			top.info.location.href=url + "_inf.htm";
		}
		else if (target == "data") {
			top.data.location.href=url + "_gfx.htm";
		}
		
	}		
		
}
function loadModelPages(url, target) {
	if (searchModel(url) == false) {
		alert(properties[selectedLangTag]['wp_modelNotExported']);
	}
        else {
		if (target == "model") {
			top.model.location.href=url + "_nav.htm";
		}
		else if (target == "info") {
			top.info.location.href=url + "_inf.htm";
		}
		else if (target == "data") {
			top.data.location.href=url + "_gfx.htm";
		}
		
	}		
		
}
</script>
